  <div class="row">
    <ng-template #tabs>
      <nb-tabset>
        <nb-tab tabTitle="What's up?">
          <div class="p-4">
            Such a wonderful day!
          </div>
        </nb-tab>
        <nb-tab tabTitle="Second Tab">
          <div class="p-4">
            Indeed!
          </div>
        </nb-tab>
      </nb-tabset>
    </ng-template>
</div> 


<nb-card>
	<nb-card-body class="example-items-rows">
        <input 
		type="text" 
		nbInput 
		status="basic" 
		placeholder="Buscar arrumes por orden"
		[(ngModel)]="inputOrder"
		[nbAutocomplete]="autoControl"
		>
  <nb-autocomplete #autoControl>
	<nb-option *ngFor="let option of orderProcess" [value]="option.order">
	  {{ option.order }}
	</nb-option>
  </nb-autocomplete>  
</nb-card-body>
